s = ""

for i in range(len(s)-1, 0, -1):
    if s[i] == "A":
        print("T", end="")
    elif s[i] == "T":
        print("A", end="")
    elif s[i] == "C":
        print("G", end="")
    if s[i] == "G":
        print("C", end="")
print("")

